import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import Quotes from './Quotes';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Route path='/quotes' component={Quotes} />
      </div>
    );
  }
}

export default App;
